INSERT INTO `recipes` VALUES (19,54,'Perfect Instant Ramen','1. Bring 2 1/2 cups of water to a boil in a small saucepan. Add the noodles and cook for 2 minutes. Add the flavor packet, stir, and continue to cook for another 30 seconds.\r\n2. Remove the pan from the heat and carefully add the egg. Do not stir; pull the noodles over the egg and let sit for one minute to poach.\r\n3. Carefully transfer everything to a serving bowl, add the butter, cheese and sesame seeds and mix. Garnish with the scallions if desired. ',10,2,1,'stefan_ramen.jpg',11),(20,55,'Chicken Spaghetti','1. Bring 2 1/2 cups of water to a boil in a small saucepan. Add the noodles and cook for 2 minutes. Add the flavor packet, stir, and continue to cook for another 30 seconds.\r\n2. Remove the pan from the heat and carefully add the egg. Do not stir; pull the noodles over the egg and let sit for one minute to poach.\r\n3. Carefully transfer everything to a serving bowl, add the butter, cheese and sesame seeds and mix. Garnish with the scallions if desired. ',30,60,5,'marko_chicken-spaghetti-recipe-1633614178.jpg',3),(21,55,'Potato salad','1. Bring 2 1/2 cups of water to a boil in a small saucepan. Add the noodles and cook for 2 minutes. Add the flavor packet, stir, and continue to cook for another 30 seconds.\r\n2. Remove the pan from the heat and carefully add the egg. Do not stir; pull the noodles over the egg and let sit for one minute to poach.\r\n3. Carefully transfer everything to a serving bowl, add the butter, cheese and sesame seeds and mix. Garnish with the scallions if desired. ',20,30,3,'marko_potatosalad_67592_16x9.jpg',5),(22,55,'American salad','1. Bring 2 1/2 cups of water to a boil in a small saucepan. Add the noodles and cook for 2 minutes. Add the flavor packet, stir, and continue to cook for another 30 seconds.\r\n2. Remove the pan from the heat and carefully add the egg. Do not stir; pull the noodles over the egg and let sit for one minute to poach.\r\n3. Carefully transfer everything to a serving bowl, add the butter, cheese and sesame seeds and mix. Garnish with the scallions if desired. ',30,2,4,'marko_american_layered_salad_22107_16x9.jpg',5),(23,56,'Homemade pizza','1. Bring 2 1/2 cups of water to a boil in a small saucepan. Add the noodles and cook for 2 minutes. Add the flavor packet, stir, and continue to cook for another 30 seconds.\r\n2. Remove the pan from the heat and carefully add the egg. Do not stir; pull the noodles over the egg and let sit for one minute to poach.\r\n3. Carefully transfer everything to a serving bowl, add the butter, cheese and sesame seeds and mix. Garnish with the scallions if desired. ',40,70,4,'maria_pizza.jpg',3),(24,56,'Homemade Pumpkin Puree','1. Bring 2 1/2 cups of water to a boil in a small saucepan. Add the noodles and cook for 2 minutes. Add the flavor packet, stir, and continue to cook for another 30 seconds.\r\n2. Remove the pan from the heat and carefully add the egg. Do not stir; pull the noodles over the egg and let sit for one minute to poach.\r\n3. Carefully transfer everything to a serving bowl, add the butter, cheese and sesame seeds and mix. Garnish with the scallions if desired. ',25,30,1,'maria_pumpkin-puree.jpg',4);
